import styled from 'styled-components';

const LogoDiv = styled('p')`
font-family: 'Monofett', cursive;
font-size:36px;
text-align:center;
color: var(--primary);`

const Logo = () => {

    return <LogoDiv>
        Jobify
    </LogoDiv>
}

export default Logo
